GM_addStyle (
    "@font-face {" +
    "    font-family: 'freeformVH';" +
    "    src: url('data:application/x-font-woff;base64,') format('woff');" +
    "    font-weight: 500;" +
    "    font-style: normal;" +
    "}" +
    "@font-face {" +
    "    font-family: '5yearsoldfont';" +
    "    src: url('data:application/x-font-woff;base64,') format('woff');" +
    "    font-weight: 500;" +
    "    font-style: normal;" +
    "}" +
    ".tweet-text {" +
    "    font-family: 'freeformVH';"+
    "}"+
    ".TweetTextSize.TweetTextSize--normal {" +
    "    font-size: 34px;"+
    "    line-height: 1.5;"+
    "}");

unsafeWindow.console.log("Added Trump style");
